const { supersonic } = inputs;
const { connectorConfigurations = {} } = self.DOLAN;
const { firebase = {} } = connectorConfigurations;

// Required property for iOS and Android initialization, but not used by us.
firebase.config.databaseURL = '';

const platformMapping = {
  iosApp: 'ios',
  androidApp: 'android',
  webApp: 'web',
};

const mapConfigObject = (firebaseConfig) => {
  const mapPlatform = (mappedConfig, platformKey, value) => {
    const platformConfig = value[platformKey] || {};
    const platform = platformMapping[platformKey];
    Object.keys(platformConfig).forEach((key) => {
      mappedConfig[key] = { ...mappedConfig[key], [platform]: platformConfig[key] };
    });
  };
  return Object.entries(firebaseConfig).reduce((initializationConfig, [key, value]) => {
    if (typeof value === 'string') {
      initializationConfig[key] = value;
    }
    if (value && key === 'apps') {
      const enabledPlatforms = Object.keys(value);
      enabledPlatforms.forEach((platformKey) => mapPlatform(initializationConfig, platformKey, value));
    }
    return initializationConfig;
  }, {});
};

try {
  supersonic.api.firebase.initialize(mapConfigObject(firebase.config));
  return [0, {}];
} catch (error) {
  return [1, {
    error: {
      code: 'initFailed',
      message: 'Initializing Firebase failed.',
      rawError: error,
    },
  }];
}

const {
  title,
  message,
  dismissLabel,
  supersonic,
} = inputs;

await supersonic.api.alert.show({
  title,
  message,
  buttonTitle: dismissLabel,
});

const { variable, supersonic, contextId } = inputs;
const { propertyPath, value } = variable;
await supersonic.context.setRootComponentProperty(propertyPath, value, contextId);

const { variable, supersonic, contextId } = inputs;
const { reference, value } = variable;
await supersonic.context.setPageVariable(reference, value, contextId);

const {
  source,
  imageQuality,
  maxWidth,
  maxHeight,
  supersonic,
} = inputs;
try {
  const res = await supersonic.api.media.v2.resizeAndCompressImage({
    source,
    width: maxWidth,
    height: maxHeight,
    quality: imageQuality,
  });
  return { imageFile: res.file };
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: 'Unknown error occurred while resizing/compressing the image',
      rawError: error,
    },
  }];
}

const {
  time,
  unit,
} = msg;

const unitCoefficientMap = {
  ms: 1,
  s: 1000,
  min: 1000 * 60,
  h: 1000 * 60 * 60,
};

if (time <= 0) {
  return msg;
}

const timeToWait = time * unitCoefficientMap[unit];

if (supersonic.api.delay) {
  supersonic.api.delay(() => { node.send(msg); }, timeToWait, msg.contextId);
} else {
  setTimeout(() => {
    node.send(msg);
  }, timeToWait);
}

const { variable, supersonic, contextId } = inputs;
const { propertyPath, value } = variable;
await supersonic.context.setRootComponentProperty(propertyPath, value, contextId);

const {
  title,
  message,
  confirmLabel,
  cancelLabel,
  supersonic,
} = inputs;

try {
  const res = await supersonic.api.confirm.show({
    title,
    message,
    buttonTitles: {
      cancel: cancelLabel,
      ok: confirmLabel,
    },
  });
  if (res.clickedIndex === 0) {
    return [1, { confirmed: false }];
  }
  return [0, { confirmed: true }];
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: 'Unknown error occurred',
      rawError: error,
    },
  }];
}

const { condition } = inputs;
if (condition) { return [0]; }
return [1];

const {
  page,
  params,
  openInModal,
  supersonic,
  contextId,
} = inputs;
const options = {
  route: page,
  params: params || {},
};
const action = openInModal ? 'pushToModal' : 'pushToStack';
await supersonic.api.navigation[action](options, contextId);

const {
  url,
  method,
  headers,
  body,
  bodyType,
} = inputs;

let stringifiedBody = null;

if (method !== 'GET' && body) {
  try {
    if (bodyType === 'json') {
      stringifiedBody = JSON.stringify(body);
    } else if (bodyType === 'x-www-form-urlencoded') {
      const paramsArray = Object.keys(body).map((key) => `${encodeURIComponent(key)}=${encodeURIComponent(body[key])}`);
      stringifiedBody = paramsArray.join('&');
    } else {
      return [1, {
        error: {
          code: 'unknownBodyType',
          message: `Unknown body type: ${bodyType}`,
          rawError: null,
        },
      }];
    }
  } catch (error) {
    return [1, {
      error: {
        code: 'bodyNotStringifiable',
        message: 'Could not stringify/process the request body',
        rawError: error,
      },
    }];
  }
}
const postRequest = new Request(url);
const reqHeaders = new Headers();

if (Array.isArray(headers)) {
  headers
    .filter(({ header, value }) => typeof header === 'string' && typeof value === 'string' && header.length && value.length)
    .forEach(({ header, value }) => reqHeaders.append(header, value));
}

let contentTypeIncluded = false;
let acceptIncluded = false;

if (Array.isArray(headers)) {
  headers.forEach((h) => {
    if (!contentTypeIncluded) contentTypeIncluded = String(h.header).toLowerCase() === 'content-type';
    if (!acceptIncluded) acceptIncluded = String(h.header).toLowerCase() === 'accept';
  });
}

if (bodyType === 'json' && !contentTypeIncluded) {
  reqHeaders.append('Content-Type', 'application/json');
}

if (bodyType === 'x-www-form-urlencoded' && !contentTypeIncluded) {
  reqHeaders.append('Content-Type', 'application/x-www-form-urlencoded');
}

if (!acceptIncluded) reqHeaders.append('Accept', 'application/json');

const init = {
  method,
  headers: reqHeaders,
  mode: 'cors',
  body: stringifiedBody,
};

try {
  const response = await fetch(postRequest, init);
  let resBodyParsed;
  let resBodyRaw;
  if (response) {
    try {
      resBodyParsed = await response.json();
      resBodyRaw = JSON.stringify(resBodyParsed);
    } catch (e) {
      resBodyParsed = null;
      resBodyRaw = null;
    }

    if (!response.ok && ((response.status >= 400 && response.status <= 451) || (response.status >= 500 && response.status <= 524))) {
      return [1, {
        statusCode: response.status,
        statusText: response.statusText,
        resHeaders: response.headers,
        resBodyRaw,
        resBodyParsed,
        resBody: resBodyParsed,
      }];
    }

    if (!response.ok) { throw response; }
    return [0, {
      statusCode: response.status,
      statusText: response.statusText,
      resHeaders: response.headers,
      resBodyRaw,
      resBodyParsed,
      resBody: resBodyParsed,
    }];
  }
} catch (error) {
  let errorStr = String(error);
  if (errorStr === 'TypeError: Failed to fetch') {
    errorStr += '. Does the server allow CORS?';
    return [2, {
      error: {
        code: 'requestFailed',
        status: error.status,
        message: errorStr,
        rawError: error,
      },
    }];
  }
  if (error.status) {
    return [2, {
      error: {
        code: 'httpError',
        message: 'Error was thrown because the response\'s status code was not 2XX, 4XX, 5XX or valid one within that range. ',
        rawError: error,
      },
    }];
  }
  return [2, {
    error: {
      code: 'unknown',
      message: `Unknown error occurred while making the ${method} request to ${url}.`,
      rawError: error,
    },
  }];
}

const {
  sourcePath,
  targetPath,
  relativeTargetPath,
  overwrite,
  supersonic,
} = inputs;
try {
  const res = await supersonic.api.fileSystem.v2.moveFile({
    sourcePath,
    targetPath: relativeTargetPath ? `/${targetPath}` : targetPath,
    relativeTargetPath,
    overwrite,
  });
  return {
    file: res.file,
  };
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: `Unknown error occured while moving the file from ${sourcePath} to ${targetPath}.`,
      rawError: error,
    },
  }];
}

const {
  fileTypes,
  pickMultiple,
  supersonic,
} = inputs;
try {
  const bFileTypes = fileTypes.map((type) => supersonic.api.media.filePicker.types(type));
  let res = await supersonic.api.media.filePicker.pick({
    type: bFileTypes,
    pickMultiple,
  });
  if (res.didCancel) {
    return [1];
  }
  if (!Array.isArray(res)) {
    res = [res];
  }
  return [0, { files: res }];
} catch (error) {
  return [2, {
    error: {
      code: 'unknown',
      message: 'Unknown error occurred while picking files.',
      rawError: error,
    },
  }];
}

const {
  wait,
  maxWait,
  trailing,
  leading,
} = msg;

if (maxWait) {
  let inThrottle = context.get('inThrottle');
  if (!inThrottle) {
    inThrottle = true;
    setTimeout(() => { node.send(msg); context.set('inThrottle', false); }, wait);
  }

  context.set('inThrottle', inThrottle);
} else {
  let timeout = context.get('timeout');
  const later = () => {
    context.set('timeout', null);
    if (!leading || trailing) node.send(msg);
  };
  const callNow = leading && !timeout;
  clearTimeout(timeout);
  timeout = setTimeout(later, wait);
  if (callNow) node.send(msg);
  context.set('timeout', timeout);
}

const {
  codeType,
  cancelLabel,
  supersonic,
} = inputs;
try {
  const { BAR_CODE_TYPES } = await supersonic.api.camera;
  const systemCodeTypes = [BAR_CODE_TYPES[codeType]];
  const res = await supersonic.api.camera.openQRCode({
    labelCancel: cancelLabel,
    codeTypes: systemCodeTypes,
  });
  if (res.state === 'cancel') {
    return [1];
  }
  return [0, {
    codeContent: res.url,
    scannedCode: res.url,
  }];
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: 'Unknown error occurred',
      rawError: error,
    },
  }];
}

const {
  path,
  supersonic,
} = inputs;
try {
  await supersonic.api.fileSystem.mkDir({
    path,
  });
  // TODO use helper to construct directory object
  return { directory: { path } };
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: `Unknown error occured while creating the directory at ${path}.`,
      rawError: error,
    },
  }];
}

const { request, contextId, supersonic } = inputs;
const { resourceName, id, parameters = {} } = request;

const { getComponentContextProp } = supersonic.context;
const { getResourceConfig } = supersonic.api.data;

const get = (p, o) => {
  const isNumber = (v) => typeof v === 'number';
  const isBoolean = (v) => typeof v === 'boolean';
  const isNull = (v) => v === null;
  const isString = (v) => typeof v === 'string';
  return p.reduce((xs, x) => (
    xs && (xs[x] || isNumber(xs[x]) || isBoolean(xs[x]) || isNull(xs[x]) || isString(xs[x])) ? xs[x] : undefined
  ), o);
};

const importRecord = (record, mappingFields = []) => {
  const importedData = {};
  mappingFields.forEach((field) => {
    if (field && field.mapping && field.mapping.length) {
      const value = get(field.mapping, record);
      if (value !== undefined) {
        importedData[field.propertyName] = value;
      }
    }
  });
  return importedData;
};

const adapterPrefix = 'adapter';
const [prefix, boundResource] = (resourceName || '').split(':');
const isAdapter = prefix === adapterPrefix;

const getActualResourceName = () => {
  if (isAdapter) {
    const adapterProp = getComponentContextProp(contextId.rootContextId, boundResource, contextId, true);
    return (
      get(['mapping', 'value'], adapterProp) || get(['value'], adapterProp) || resourceName
    );
  }
  return resourceName;
};

const getMapping = () => (
  isAdapter
    ? get(['mapping', 'fields'], getComponentContextProp(contextId.rootContextId, boundResource, contextId, true))
    : null
);

const getAdapterFields = () => {
  const adapterFields = {};
  const fields = ['identifier'];
  if (isAdapter) {
    const adapterProp = getComponentContextProp(contextId.rootContextId, boundResource, contextId, true);
    fields.forEach((field) => {
      adapterFields[field] = get(['mapping', field], adapterProp) || get([field], adapterProp);
    });
  }
  return adapterFields;
};

// TODO: should be handled in odata driver in a future version of
// api-configurator using string schema format field set to "uuid"
const uuidMatcher = /^[0-9a-f]{8}-[0-9a-f]{4}-[1-5][0-9a-f]{3}-[89ab][0-9a-f]{3}-[0-9a-f]{12}$/i;
const fixIdentifierValue = (value) => (value && typeof value === 'string' && !uuidMatcher.test(value) ? `'${value}'` : value);
const prepareQuery = (query, resourceType) => {
  if (resourceType === 'odata' && query.identifier && Object.keys(query.identifier).length > 1) {
    return { ...query, identifier: Object.keys(query.identifier).reduce((acc, key) => ({ ...acc, [key]: fixIdentifierValue(query.identifier[key]) }), {}) };
  }
  return query;
};

const mappingFields = getMapping(resourceName);
const isMappedAdapter = isAdapter && !!mappingFields;

async function makeRequest() {
  const resourceConfig = getResourceConfig(getActualResourceName(resourceName));
  const { driverConfiguration = {} } = resourceConfig;
  const resourceType = resourceConfig.type || driverConfiguration.type;

  if (!resourceConfig) {
    // This is assumed to be a legacy data resource
    const data = await supersonic.resource.find(resourceName, id, {});
    return data && data.value && data.value.object;
  }
  // Load a local data resource
  if (resourceType === 'local') {
    const { appId } = await supersonic.api.app.getAppId();
    const key = `local-resource:${appId}:${resourceName}:${id}`;
    const { data: record } = await supersonic.api.asyncStorage.getItem({ key });
    if (record != null && typeof record === 'object' && typeof record.id !== 'undefined') {
      return record;
    }
    throw new Error(`Record ${resourceName} with ID ${id} not found`);
  }
  if (resourceType === 'agdb') {
    const data = await supersonic.resource.find(resourceConfig.agdb_id, id, {});
    return data && data.value && data.value.object;
  }
  if (supersonic.api.data.drivers && resourceType in supersonic.api.data.drivers) {
    const driver = supersonic.api.data.drivers[resourceType];
    if (!driver.execute) {
      throw new Error(`Invalid or missing driver for Resource ${resourceName}`);
    }
    let authConfig;
    if (resourceType === 'firestore') {
      try {
        const { firebase } = supersonic.api;
        const currentUser = await new Promise((resolve, reject) => {
          const unsubscribe = firebase.auth().onAuthStateChanged((user) => {
            unsubscribe();
            resolve(user);
          }, reject);
        });
        const token = await currentUser.getIdToken();
        authConfig = {
          type: 'bearer',
          authToken: token,
        };
      } catch (err) {
        /* ignore error and attempt query anyway */
      }
    }
    const agQuery = prepareQuery({
      resource: resourceConfig,
      operation: 'retrieve',
      authConfig,
      ...request,
      ...getAdapterFields(),
    }, resourceType);
    const response = await driver.execute(agQuery);
    if (!response || response.message) {
      if (resourceType === 'firestore') {
        let code; let message; let status;
        try {
          ({ code, message, status } = response.driverRawError.response.data.error);
        } catch (e) {
          message = response.message;
        }
        // eslint-disable-next-line no-throw-literal
        throw {
          type: 'firestore',
          code,
          message,
          status,
        };
      }
      throw new Error(response ? response.message : 'Request failed');
    }
    const record = response.record || response.data || null;
    return record;
  }
  // Load a "REST" data resource
  const operation = resourceConfig.operations.retrieve;
  if (!operation) {
    throw new Error(`Resource ${resourceName} does not support getting a single record`);
  }
  const requestParameters = [
    ...resourceConfig.parameters,
    ...operation.parameters,
  ];
  const headers = {};
  const queryComponents = [];
  let url = `${resourceConfig.base_url}${operation.relative_path || ''}`;
  requestParameters.forEach((parameter) => {
    let value = parameters[parameter.id];
    if (parameter.is_static || typeof value === 'undefined') {
      value = parameter.default;
    }
    if (value == null) {
    // No value for this parameter
      if (parameter.is_optional) {
        return;
      }
      throw new Error(`Missing required parameter ${JSON.stringify(parameter.title)}`);
    }
    // Map the parameter to headers/URL/query
    const { placement } = parameter;
    const placementKey = parameter.placement_key;
    if (placement === 'header') {
      // Add to headers
      headers[placementKey] = value;
    } else if (placement === 'query') {
      // Add to the URL as a query parameter
      queryComponents.push(`${encodeURIComponent(placementKey)}=${encodeURIComponent(String(value))}`);
    } else if (placement === 'path') {
      // Replace the placeholder in the URL with escaped string
      url = url.replace(new RegExp(`{\\s*${placementKey}\\s*}`, 'g'), encodeURIComponent(String(value)));
    } else if (placement === 'url') {
      // Replace the placeholder in the URL with unescaped string
      url = url.replace(new RegExp(`{\\s*${placementKey}\\s*}`, 'g'), String(value));
    }
  });
  // Add any query parameters to the URL
  if (queryComponents.length) {
    const newQuery = queryComponents.join('&');
    url = url.replace(/(?:\?(.*))?$/, (_, query) => (query ? `?${query}&${newQuery}` : `?${newQuery}`));
  }
  // Perform the request
  const response = await fetch(url, { method: 'GET', headers });
  if (!response.ok) {
    throw response;
  }
  let result = await response.json();
  const resultPath = operation.response_key_path ? operation.response_key_path.split('.') : [];
  while (result != null && resultPath.length) {
    result = result[resultPath.shift()];
  }
  if (!result) {
    throw new Error(`A ${resourceName} record not found from the response!`);
  }
  return result;
}

try {
  const record = await makeRequest();
  if (Array.isArray(record)) {
    const errorStr = 'The server responded with a list for a single data record. The response must be an object.';
    return [1, {
      error: {
        code: 'responseMustBeObject',
        status: -1,
        message: errorStr,
        rawError: new Error(errorStr),
      },
    }];
  }

  return [0, { record: !isMappedAdapter ? record : importRecord(record, mappingFields) }];
} catch (error) {
  // eslint-disable-next-line no-console
  // console.warn(error);
  if (error.type === 'firestore') {
    return [1, {
      error: {
        code: 'requestFailed',
        status: error.code,
        message: `${error.status}: ${error.message}`,
      },
    }];
  }

  let errorStr = String(error);

  if (errorStr.startsWith('Error: Couldn\'t find data resource')) {
    return [1, {
      error: {
        code: 'resourceNotFound',
        status: 404,
        message: errorStr,
        rawError: error,
      },
    }];
  }
  if (errorStr === 'TypeError: Failed to fetch') {
    errorStr += '. Does the server allow CORS?';
    return [1, {
      error: {
        code: 'requestFailed',
        status: error.status,
        message: errorStr,
        rawError: error,
      },
    }];
  } if (!error.json) {
    return [1, {
      error: {
        code: 'unknown',
        status: -1,
        message: errorStr,
        rawError: error,
      },
    }];
  }
  let rawError;
  try {
    const body = await error.json();
    rawError = body;
    errorStr = `JSON error response from server: ${JSON.stringify(body)}.`;
  } catch {
    errorStr = 'Non-JSON error body.';
    rawError = { message: errorStr };
  } finally {
    // eslint-disable-next-line no-unsafe-finally
    return [1, {
      error: {
        code: 'serverError',
        status: error.status,
        message: errorStr,
        rawError,
      },
    }];
  }
}

const {
  initialDate,
  confirmLabel,
  cancelLabel,
  minDate,
  maxDate,
  supersonic,
} = inputs;

try {
  const res = await supersonic.api.datePicker.show({
    value: initialDate,
    confirmBtnText: confirmLabel,
    cancelBtnText: cancelLabel,
    mode: 'date',
    minDate,
    maxDate,
    format: 'YYYY-MM-DD',
  });
  if (res.didCancel) {
    return [1];
  }
  return [0, { pickedDate: res.datetime }];
} catch (error) {
  return [2, {
    error: {
      code: 'unknown',
      message: 'Unknown error occurred while picking a date.',
      rawError: error,
    },
  }];
}

const {
  page,
  params,
  openInModal,
  supersonic,
  contextId,
} = inputs;

const options = {
  route: page,
  params: params || {},
};

const action = openInModal ? 'replaceToModal' : 'replaceToStack';

await supersonic.api.navigation[action](options, contextId);

const {
  url,
  withButton,
  supersonic,
} = inputs;
try {
  return await supersonic.api.webBrowser.open({
    url,
    withButton,
  });
} catch (error) {
  return [1, {
    error: {
      code: 'unknown',
      message: 'Unknown error occured while opening the web browser.',
      rawError: error,
    },
  }];
}

const { request, contextId, supersonic } = inputs;
const { resourceName, properties = {}, parameters = {} } = request;

const { getComponentContextProp } = supersonic.context;
const { getResourceConfig } = supersonic.api.data;

const get = (p, o) => {
  const isNumber = (v) => typeof v === 'number';
  const isBoolean = (v) => typeof v === 'boolean';
  const isNull = (v) => v === null;
  const isString = (v) => typeof v === 'string';
  return p.reduce((xs, x) => (
    xs && (xs[x] || isNumber(xs[x]) || isBoolean(xs[x]) || isNull(xs[x]) || isString(xs[x])) ? xs[x] : undefined
  ), o);
};

const importRecord = (record, mappingFields = []) => {
  const importedData = {};
  mappingFields.forEach((field) => {
    if (field && field.mapping && field.mapping.length) {
      const value = get(field.mapping, record);
      if (value !== undefined) {
        importedData[field.propertyName] = value;
      }
    }
  });
  return importedData;
};

const setNestedProp = (obj = {}, [first, ...rest], value) => ({
  ...obj,
  [first]: rest.length
    ? setNestedProp(obj[first], rest, value)
    : value,
});

const exportRecord = (record, mappingFields = []) => {
  let exportedRecord = {};
  mappingFields.forEach((field) => {
    if (field && field.mapping && field.mapping.length) {
      exportedRecord = setNestedProp(exportedRecord, field.mapping, get([field.propertyName], record));
    }
  });
  return exportedRecord;
};

const exportResourceConfig = (resourceConfig, mappingFields) => {
  const exportedResourceConfig = { ...resourceConfig };
  if (resourceConfig.record) {
    exportedResourceConfig.record = exportRecord(resourceConfig.record, mappingFields);
  }
  return exportedResourceConfig;
};

const adapterPrefix = 'adapter';
const [prefix, boundResource] = (resourceName || '').split(':');
const isAdapter = prefix === adapterPrefix;

const getActualResourceName = () => {
  if (isAdapter) {
    const adapterProp = getComponentContextProp(contextId.rootContextId, boundResource, contextId, true);
    return (
      get(['mapping', 'value'], adapterProp) || get(['value'], adapterProp) || resourceName
    );
  }
  return resourceName;
};

const getMapping = () => (
  isAdapter
    ? get(['mapping', 'fields'], getComponentContextProp(contextId.rootContextId, boundResource, contextId, true))
    : null
);

const mappingFields = getMapping(resourceName);
const isMappedAdapter = isAdapter && !!mappingFields;

async function makeRequest() {
  const resourceConfig = getResourceConfig(getActualResourceName(resourceName));
  const { driverConfiguration = {} } = resourceConfig;
  const resourceType = resourceConfig.type || driverConfiguration.type;

  const getTLD = () => {
    const environment = self.DOLAN.environment.endpoints.data;
