});
let errored = false;
let jobId;

try {
  if (filesToUpload.length === 0) {
    throw new Error('noFilesToUpload');
  }
  const files = await Promise.all(filesToUploadWithId.map(async (file) => {
    let skip = false;
    try {
      filesForEvents = filesForEvents.map((fileForEvent) => {
        if (file.id === fileForEvent.id) {
          if (fileForEvent.uploadStatus === 'errored') {
            skip = true;
            return {
              ...fileForEvent,
              uploadStatus: 'errored',
            };
          }
        }
        return fileForEvent;
      });
      if (!file.url) {
        file.url = file.path;
      }
      let res;
      let resStatus;
      if (!skip) {
        res = await supersonic.api.data.uploadFile({
          file,
          toUrl: file.uploadUrl,
          method,
          headers,
          // eslint-disable-next-line no-console
          begin: (b) => { jobId = (b.jobIdUpload || b.jobId); },
          progress: async (a) => {
            filesForEvents = filesForEvents.map((fileForEvent) => {
              // This needs to be implemented, one option is to pass the file id to API and just return it in the progress
              if (a.uniqueUploadId) {
                if (file.id === a.uniqueUploadId) {
                  return {
                    ...fileForEvent,
                    bytesUploaded: a.totalBytesSent,
                    uploadStatus: 'uploading',
                  };
                }
                return fileForEvent;
              }
              if (file.id === fileForEvent.id) {
                return {
                  ...fileForEvent,
                  bytesUploaded: a.totalBytesSent,
                  uploadStatus: 'uploading',
                };
              }
              return fileForEvent;
            });
            try {
              await supersonic.api.events.send('onFileUploadProgress', {
                jobId: jobId || null,
                totalSize,
                bytesUploaded: bytesUploaded + a.totalBytesSent || null,
                files: [
                  filesForEvents.map((f) => {
                    const { id, ...rest } = f;
                    if (id !== file.id) {
                      return rest;
                    }
                    return rest;
                  }),
                ],
              }, { contextId });
            } catch (e) {
              // eslint-disable-next-line no-console
              console.log('Error occurred while trying to send event');
            }
          },
        });
        if (res) {
          resStatus = res.statusText === 'OK' || res.statusCode === 200 ? 'completed' : 'errored';
          if (resStatus !== 'errored') {
            bytesUploaded += file.size;
          }
        } else {
          resStatus = 'errored';
        }
      }
      filesForEvents = filesForEvents.map((fileForEvent) => {
        if (file.id === fileForEvent.id) {
          return {
            ...fileForEvent,
            bytesUploaded: resStatus === 'completed' ? file.size : fileForEvent.bytesUploaded,
            uploadStatus: res ? resStatus : 'errored',
          };
        }
        return fileForEvent;
      });

      // eslint-disable-next-line no-nested-ternary
      const cleanedFile = { ...file, uploadStatus: resStatus };
      if (!errored) { errored = resStatus === 'errored'; }
      delete cleanedFile.path;
