    newFile.path = result.path();
    const responseHeaders = result.info().headers;
    const lowerCaseHeaders = {};
    Object.keys(responseHeaders).forEach((hdr) => {
      lowerCaseHeaders[hdr.toLowerCase()] = responseHeaders[hdr];
    });
    newFile.size = parseInt(lowerCaseHeaders['content-length'], 10);
    newFile.mimeType = lowerCaseHeaders['content-type'];
    return newFile;
  });
}

try {
  const newFiles = await Promise.all(fetches);
  return {
    files: newFiles,
  };
} catch (error) {
  return [1, {
    error,
    message: String(error),
  }];
}

